function Tagline() {
  return (
    <div>
      <p className="text-5xl">
        an interdisciplinary designer focused on creating meaningful user experiences
      </p>
    </div>
  );
}

export default function Home() {
  return (
    <footer>
      <div>
        <Tagline />
      </div>
    </footer>
  );
}
